[[File:Umar Naseer.jpg|thumb|Umar Naseer in 2015.]]
'''Umar Naseer''' is a Maldivian politician.<ref>{{Cite web |title=Umar Naseer announces presidential bid to take Maldives in "A New Direction" |url=https://edition.mv/news/27033 |access-date=2023-09-09 |website=The Edition |language=en}}</ref> He is a former Home Minister and was an Independent candidate in the [[2023 Maldivian presidential election]].<ref>{{Cite web |date=2016-08-03 |title=A conversation with Umar Naseer |url=https://maldivesindependent.com/feature-comment/a-conversation-with-umar-naseer-125193 |access-date=2023-09-09 |language=en-US}}</ref> He came in fourth place out of eight candidates.<ref>{{Cite web |date=2023-09-09 |title=Maldives presidential election heading for 2nd round after no clear winner emerges |url=https://apnews.com/article/maldives-election-india-china-solih-muiz-47a5cd07488b4a6956e0728e2fca9fe3 |access-date=2023-09-10 |website=AP News |language=en}}</ref>

